  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115173 includes chemical,
  discrete sample, meteorological, physical, profile and underway - surface data collected
  from METEOR in the South Atlantic Ocean from 1992-12-27 to 1993-01-31 and retrieved
  during cruise 06MT22_5 and WOCE_A10. These data include ALKALINITY, BAROMETRIC PRESSURE,
  CARBON DIOXIDE - AIR, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
  Carbon tetrachloride (CCL4), DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, Delta Oxygen - 18, HELIUM, HYDROSTATIC PRESSURE, NEON,
  NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, Partial pressure (or fugacity)
  of carbon dioxide, Potential temperature (theta), SALINITY, SEA SURFACE TEMPERATURE,
  SILICATE, Tritium (Hydrogen isotope), WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD, Carbon dioxide (CO2) gas analyzer, Shower
  head chamber equilibrator for autonomous carbon dioxide (CO2) measurement and bottle.
  These data were collected by Douglas Wallace of Universitat Kiel; Institut Fur Meereskunde;
  Forschungsbereich Marine Biogeochemie and Kenneth Johnson [affiliation unknown]
  as part of the WOCE A10 and WOCE_A10 data set.nnThe World Ocean Circulation Experiment
  (WOCE) was a major component of the World Climate Research Program with the overall
  goal of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
